import React, {useState, useEffect} from 'react';
import axios from 'axios';
import './App.css';

const App = () => {

  let [cast, setCast] = useState([])

  const getCast = () => {
    axios
        .get('http://localhost:8000/api/cast')
        .then(
          (response) => setCast(response.data),
          (err) => console.error(err)
        )
  }

  useEffect(() => {
    getCast()
  }, [])

  return(
    <>
    </>
  )
}

export default App;
